%[text] # Sistemas Lineales invariantes en el tiempo
%%
%[text] ## Deltas de Kronecker y Dirac
%[text] ![](text:image:67ae)
%[text] ![](text:image:8d44)
%[text] 1\.- Intentar plotear la delta de Dirac.
%[text] 2\.- Plotear delta de Kronecker
clear 

syms n t

figure %[output:2a41afc2]
fplot(kroneckerDelta(n)) %[output:4e9e15cd] %[output:2a41afc2]

figure %[output:619d6157]
fplot(dirac(t)) %[output:619d6157]


%[text] La delta de Dirac no se puede graficar porque en realidad no se trata de "una flecha de altura 1", sino que tiene altura infinita y Matlab no lo puede graficar.
%[text] ![](text:image:8f51)
%%
%[text] ## Sifting property
%[text] 
%[text] 1\.- Crear un vector $n${"editStyle":"visual"} y $x${"editStyle":"visual"} con la señal de la imagen
%[text] ![](text:image:607c)
%[text] 2\.- Abrir elemento por elemento la siguiente suma, usando la señal anterior:
%[text] ![](text:image:28af)
%[text] Consultar la presentación
clear 

syms n
n_d = [-4:4] %[output:1a7339aa]
x = [-1 2 2 -1 3 1 -3 -1 1] %[output:2dd8732c]

%1.-
figure %[output:08d5f8a7]
stem(n_d,x) %[output:08d5f8a7]

x_r = 0 %[output:4f1dceef]

%2.-
%Porque Josué lo pidió
for i = 1:length(n_d)
    x_r = x_r + x(i)*kroneckerDelta(n-n_d(i));
end
x_r %[output:6125fa29]

figure
stem(n_d,subs(x_r,n,n_d)) %[output:232db789]

