%[text] 1\.- Definir los vectores $n${"editStyle":"visual"}, $h${"editStyle":"visual"} y $x${"editStyle":"visual"}
%[text] 2\.- Escribir manualmente los vectores (Es buena idea dibujarlos) $h\\left\\lbrack x\\left\\lbrack 0\\right\\rbrack \\right\\rbrack${"editStyle":"visual"} y $h\\left\\lbrack x\\left\\lbrack 1\\right\\rbrack \\right\\rbrack${"editStyle":"visual"}
%[text] 3\.- Escribir el resultado $y\\left\\lbrack n\\right\\rbrack =\\Sigma\_{k=0\\;}^{k=2} h\\left\\lbrack x\\left\\lbrack n-k\\right\\rbrack \\right\\rbrack${"editStyle":"visual"}
 


%[text] 1\.- Calcular la convolución $y\\left\\lbrack n\\right\\rbrack =x\\left\\lbrack n\\right\\rbrack \*h\\left\\lbrack n\\right\\rbrack${"editStyle":"visual"} a *lápiz y papel*
